const initialState = {
  yandexDrive:false,
    delimobil:false,
    belkaCar:false,
    youDrive:false,
    rentmee:false,
    bibi:false,
    sber:false,
    citi:false
}

export default function adminReducer(state = initialState, action ) {
  switch (action.type){

    case 'COPYYANDEX':
   return {...state, yandexDrive: action.payload}

   case 'CHANGEDELI':
    return {...state, delimobil: action.payload}

    default:
      return state
  }


}
